import React, { Component } from 'react';
import { ApolloProvider } from '@apollo/client';

class Resultados extends React.Component{

    render(){
        let query = useQuery();
        return(
            <div>
                <h1>Se muestran los resultados para la url</h1>
                <p>query.get</p>
            </div>
        )
    }
}

export default Resultados;
